        <ul>
            <li> <a href='/#' onClick={() => onMenuSelect('menu1')}>Clientes</a></li>
       
            <li> <a href='/#'>Ordenes de Trabajo</a></li>
     
            <li> <a href='/#'>Tickets</a></li>
      
